{
  "extends": [
    "config:js-app",
    "group:definitelyTyped",
    "group:socketio",
    "group:linters",
    "group:test",
    "group:reactMonorepo",
    "group:typescript-eslintMonorepo",
    "docker:enableMajor",
    "docker:pinDigests",
    "default:automergeDigest",
    ":gitSignOff",
    ":prHourlyLimitNone",
    ":maintainLockFilesWeekly",
    ":automergePatch",
    ":separateMajorReleases"
  ],
  "baseBranches": [
    "master",
    "develop"
  ],
  "labels": [
    "type: maintenance"
  ],
  "ignorePaths": [
    "docker/docker-compose.yml"
  ],
  "packageRules": [
    {
      "groupName": "NestJS packages",
      "packagePatterns": [
        "^@nestjs/"
      ]
    },
    {
      "groupName": "Graphviz",
      "packagePatterns": [
        "d3-graphviz",
        "@hpcc-js/wasm"
      ]
    },
    {
      "groupName": "cypress",
      "matchPackagePatterns": [
        "^@cypress",
        "^cypress"
      ]
    },
    {
      "groupName": "vega",
      "packagePatterns": [
        "vega",
        "vega-embed",
        "vega-lite"
      ]
    },
    {
      "groupName": "i18next",
      "matchPackagePatterns": [
        "i18next",
        "i18next-browser-languagedetector",
        "i18next-http-backend",
        "react-i18next"
      ]
    },
    {
      "groupName": "CodeMirror",
      "matchPackagePatterns": [
        "^@codemirror/",
        "@uiw/react-codemirror"
      ]
    },
    {
      "groupName": "testing-library",
      "matchPackagePatterns": [
        "^@testing-library/"
      ]
    },
    {
      "groupName": "zxcvbn-ts",
      "matchPackagePatterns": [
        "^@zxcvbn-ts/"
      ]
    }
  ],
  "regexManagers": [
    {
      "fileMatch": [
        "\\.yml$",
        "\\.yaml$"
      ],
      "matchStrings": [
        "# renovate: datasource=(?<datasource>.*?) depName=(?<depName>.*?)( versioning=(?<versioning>.*?))?\\s+\\S+:\\s+\"?(?<currentValue>[^\"]*?)\"?\\s"
      ],
      "versioningTemplate": "{{#if versioning}}{{{versioning}}}{{else}}semver{{/if}}",
      "extractVersionTemplate": "^v(?<version>.*)$"
    },
    {
      "fileMatch": [
        "package.json"
      ],
      "matchStrings": [
        "yjs@(?:npm%3A)?(?<currentValue>[\\d\\.]+)"
      ],
      "datasourceTemplate": "npm",
      "depNameTemplate": "yjs"
    },
    {
      "fileMatch": [
        "package.json"
      ],
      "matchStrings": [
        "@dicebear/converter@(?:npm%3A)?(?<currentValue>[\\d\\.]+)"
      ],
      "datasourceTemplate": "npm",
      "depNameTemplate": "@dicebear/converter"
    }
  ]
}

{
  "$schema": "https://turbo.build/schema.json",
  "tasks": {
    "build": {},
    "@hedgedoc/html-to-react#build": {
      "dependsOn": [
        "^build"
      ],
      "outputs": [
        "dist/**"
      ]
    },
    "@hedgedoc/commons#build": {
      "dependsOn": [
        "^build"
      ],
      "outputs": [
        "dist/**"
      ]
    },
    "@hedgedoc/markdown-it-plugins#build": {
      "dependsOn": [
        "^build"
      ],
      "outputs": [
        "dist/**"
      ]
    },
    "@hedgedoc/frontend#build": {
      "dependsOn": [
        "^build"
      ],
      "outputs": [
        "dist/**",
        "!.next/**"
      ],
      "env": [
        "NODEJS_VERSION"
      ]
    },
    "@hedgedoc/backend#build": {
      "dependsOn": [
        "^build"
      ],
      "outputs": [
        "dist/**"
      ],
      "env": [
        "NODEJS_VERSION"
      ]
    },
    "build:test": {},
    "@hedgedoc/frontend#build:test": {
      "dependsOn": [
        "^build"
      ],
      "outputs": [
        "dist/**",
        "!.next/**"
      ],
      "env": [
        "NODEJS_VERSION"
      ]
    },
    "lint": {
      "dependsOn": [
        "^build"
      ]
    },
    "lint:fix": {
      "dependsOn": [
        "^build"
      ]
    },
    "format": {},
    "test": {
      "dependsOn": [
        "^build"
      ]
    },
    "test:ci": {
      "dependsOn": [
        "^build"
      ],
      "env": [
        "NODEJS_VERSION"
      ],
      "outputs": [
        "coverage/**"
      ]
    },
    "test:e2e:ci": {},
    "@hedgedoc/frontend#test:e2e:ci": {
      "dependsOn": [
        "^build"
      ],
      "env": [
        "CYPRESS_CONTAINER_ID"
      ]
    },
    "@hedgedoc/backend#test:e2e:ci": {
      "dependsOn": [
        "^build"
      ],
      "env": [
        "HEDGEDOC_TEST_DB_TYPE"
      ],
      "outputs": [
        "coverage-e2e/**"
      ]
    },
    "start:dev": {
      "dependsOn": [
        "^build"
      ],
      "cache": false,
      "persistent": true
    },
    "start": {
      "cache": false,
      "persistent": true
    }
  }
}
